export default <style>{`
    body {
        margin: 10px;
        padding: 5px;
        color: #669;
    }

    header {
        font-size: 64pt;
        font-weight: bold;
        text-align: right;
        letter-spacing: -8px;
        color: "#ddddff;
        margin: -32px 5px;
    }
    footer {
        color: #99c;
        font-size: 12pt;
        text-align: right;
        border-bottom: 1px solid #99c;
        margin: 50px 0px 10px 0px;
        position: relative;
        bottom: 10px;
        left: 10px;
    }

    h1 {
        font-size: 68pt;
        font-weight: bold;
        text-align: right;
        letter-spacing: -8px;
        color: #f0f0f0;
        margin: -32px 0px;
    }

    p {
        margin: 0px;
        color: blue;
        font-size: 16pt;
    }
`}
</style>
